import React from "react";

import { Container } from "@material-ui/core";

import TodoCard from "./TodoCard";
import { TodoType } from "../../types/types";

type PropsType = {
  allTodos: TodoType[];
};

function AllTodos(props: PropsType) {
  const { allTodos } = props;

  return (
    <section>
      <Container>
        {allTodos.map((todo) => (
          <TodoCard
            key={todo.id}
            title={todo.title}
            description="Complete this project as soon as possible."
            isDeleting={false}
            isMarkingAsCompleted={false}
            deleteHandler={() => {}}
            markAsCompletedHandler={() => {}}
            isCompleted={todo.completed}
          />
        ))}

        <TodoCard
          title="Mern Stack Todo App"
          description="Complete this project as soon as possible."
          isDeleting={false}
          isMarkingAsCompleted={false}
          deleteHandler={() => {}}
          markAsCompletedHandler={() => {}}
          isCompleted={false}
        />
      </Container>
    </section>
  );
}

export default AllTodos;
